import React from "react";
import {AppBar, Toolbar } from "@mui/material";

const LoginDialog = () => {
  return (<div>
    <AppBar>
        <ToolBar>
        Hello from login
        </ToolBar>
    </AppBar>
    </div>
  );
};

export default LoginDialog;
